    {
        bytes memory encodedUserAddress = abi.encodePacked(msg.sender);
        bytes32 leaf = keccak256(encodedUserAddress);
        bool isProofValid = MerkleProof.verify(merkleProof, rootHash, leaf);

        return isProofValid;
